import React from 'react';
import './Checkbox.css'; // Import the CSS file for styling

const Checkbox = () => {
  return (
    <label className="checkbox-container">
      <input type="checkbox" />
      <span className="checkmark"></span>
    </label>
  );
};

export default Checkbox;
